import React from 'react';
import Navbar from './Navbar';


const Contact = () => {
    return (
        <>
            <Navbar />
            <div className='container'>

                <h1 align='center'>Contact Us</h1>
                <div className='contact_form'>

                    <form>
                        <input type='text' name='name' value='' placeholder='Enter Your Name ' />
                        <input type='email' name='email' value='' placeholder='Enter Your Email Id' />
                        <input type='text' name='pnumber' value='' placeholder='Enter Your Phone Number' />
                        <textarea type="text" name='msg' cols="77" rows="10" placeholder='Message'></textarea>
                        <a className='btn'></a>
                    </form>
                </div>

            </div>
        </>
    )
}
export default Contact;
